const buttons = {
	loaded: false,
	schemes: {
		global: {
			xbox: {},
			ps: {}
		},

		keyboard: {
			xbox: {},
			ps: {}
		},

		youtube: {
			xbox: {},
			ps: {}
		},

		youtube_player: {
			xbox: {},
			ps: {}
		}
	}
};

buttons.global = {
	rs: {},
	ls: {},
	dpad: {}
}

buttons.xbox = {};
buttons.ps = {};

// Load all images from B64 uri components
buttons.load = function() {
	// Global
	buttons.global.ls.neutral = loadImage( "data:image/png;base64," );
	buttons.global.rs.neutral = loadImage( "data:image/png;base64," );
	buttons.global.dpad.neutral = loadImage( "data:image/png;base64," );
	buttons.global.lb = loadImage( "data:image/png;base64," );
	buttons.global.rb = loadImage( "data:image/png;base64," );
	buttons.global.lt = loadImage( "data:image/png;base64," );
	buttons.global.rt = loadImage( "data:image/png;base64," );

	// Xbox
	buttons.xbox.a = loadImage( "data:image/png;base64," );
	buttons.xbox.b = loadImage( "data:image/png;base64," );
	buttons.xbox.x = loadImage( "data:image/png;base64," );
	buttons.xbox.y = loadImage( "data:image/png;base64," );
	buttons.xbox.menu = loadImage( "data:image/png;base64," );
	buttons.xbox.select = loadImage( "data:image/png;base64," );

	// Play Station
	buttons.ps.cross = loadImage( "data:image/png;base64," );
	buttons.ps.triangle = loadImage( "data:image/png;base64," );
	buttons.ps.square = loadImage( "data:image/png;base64," );
	buttons.ps.circle = loadImage( "data:image/png;base64," );
	buttons.ps.option = loadImage( "data:image/png;base64," );
	buttons.ps.share = loadImage( "data:image/png;base64," );

	buttons.loadSchemes();
}

buttons.loadSchemes = function() {

	// Global

	buttons.schemes.global.xbox = [
		buttons.global.ls.neutral, 
		buttons.global.lb, 
		buttons.global.lt, 
		buttons.xbox.select,
		buttons.xbox.a,
		buttons.xbox.menu,
		buttons.global.rt,
		buttons.global.rb, 
		buttons.global.rs.neutral
	];

	buttons.schemes.global.ps = [
		buttons.global.ls.neutral, 
		buttons.global.lb, 
		buttons.global.lt, 
		buttons.ps.share,
		buttons.ps.cross,
		buttons.ps.option,
		buttons.global.rt,
		buttons.global.rb, 
		buttons.global.rs.neutral
	];

	// On Screen Keyboard

	buttons.schemes.keyboard.xbox = [
		buttons.global.ls.neutral, 
		buttons.xbox.a,
		buttons.xbox.b,
		buttons.xbox.y,
		buttons.xbox.x,
		buttons.xbox.menu,
		buttons.global.dpad.neutral
	];

	buttons.schemes.keyboard.ps = [
		buttons.global.ls.neutral, 
		buttons.ps.cross,
		buttons.ps.circle,
		buttons.ps.triangle,
		buttons.ps.square,
		buttons.ps.option,
		buttons.global.dpad.neutral
	];

	// Youtube Global

	buttons.schemes.youtube.xbox = [
		buttons.global.ls.neutral, 
		buttons.global.lb, 
		buttons.global.lt, 
		buttons.xbox.select,
		buttons.xbox.a,
		buttons.xbox.menu,
		buttons.global.rt,
		buttons.global.rb, 
		buttons.global.rs.neutral,
		buttons.global.dpad.neutral
	];

	buttons.schemes.youtube.ps = [
		buttons.global.ls.neutral, 
		buttons.global.lb, 
		buttons.global.lt, 
		buttons.ps.share,
		buttons.ps.cross,
		buttons.ps.option,
		buttons.global.rt,
		buttons.global.rb, 
		buttons.global.rs.neutral,
		buttons.global.dpad.neutral
	];

	// Youtube Player

	buttons.schemes.youtube_player.xbox = [
		buttons.global.ls.neutral, 
		buttons.global.lb, 
		buttons.global.lt, 
		buttons.xbox.select,
		buttons.xbox.a,
		buttons.xbox.x,
		buttons.xbox.y,
		buttons.xbox.b,
		buttons.xbox.menu,
		buttons.global.rt,
		buttons.global.rb, 
		buttons.global.rs.neutral,
		buttons.global.dpad.neutral
	];

	buttons.schemes.youtube_player.ps = [
		buttons.global.ls.neutral, 
		buttons.global.lb, 
		buttons.global.lt, 
		buttons.ps.share,
		buttons.ps.cross,
		buttons.ps.square,
		buttons.ps.triangle,
		buttons.ps.circle,
		buttons.ps.option,
		buttons.global.rt,
		buttons.global.rb, 
		buttons.global.rs.neutral,
		buttons.global.dpad.neutral
	];

	buttons.currentScheme = buttons.schemes.global.xbox;
	buttons.loaded = true;
}

buttons.controllerType = function() {
	const id = controllers[0].id.toLowerCase();
	return id.match( /playstation/ ) ? "PS" : "XBOX";
}